const App = (props) => {
    const [allPosts, getAllPosts] = useState([]);

    const fetchAllPosts = async () => {
        const posts = await fetch(`https://strangers-things.herokuapp.com/api/${ cohort }/posts`)
        .then(response => response.json())
        .then(result => {
            console.log(result);
        })
        .catch(console.error);
        getAllPosts(posts);
    }
    fetchAllPosts()
    return (
    <div>{ allPosts }</div>
    )
}

